package array;

public class Mult_without_3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int[][] ed= {{3,4,7},{2,9,8},{1,3,2}};
		
		for(int i=0;i<3;i++) {
			for(int j=0;j<3;j++) {
				System.out.print("ed[" + i + "][" + j +"]="+ed [i] [j]+" ");
		}
			System.out.println();
		}
	}

}
